import React from 'react';

import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image'
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import NavDropdown from 'react-bootstrap/NavDropdown'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import Dropdown from 'react-bootstrap/Dropdown'
import CardGroup from 'react-bootstrap/CardGroup'
import Toast from 'react-bootstrap/Toast'
import Carousel from 'react-bootstrap/Carousel'
import ToastContainer from 'react-bootstrap/ToastContainer'

import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
  Outlet
} from "react-router-dom";

class viewCats extends React.Component {

    constructor(props) {
      super(props);
      this.state = {
        chatList: []
      };

    } 

    render() {
      return(
        <div className="container start" style={{maxWidth: "100%",maxHeight:"100%"}}>
            <Link to="/user/login" class="link-light">  <Button variant="warning">Admin page</Button> </Link>
        </div>

      );
    }
  }

export default viewCats;
